(20, 74, 'Corporate', 'creative-ideas', '<p>Corporate interior design and fitout in Perth, WA</p>\r\n', '\r\n<p>NRG INTERIORS has successfully delivered the design and fitout for many businessesin a range of industries which includes accounting, engineering, surveying, recruitment, oil &amp; gas, and building.</p>\r\n<p>We understand what makes a business efficient, and how to keep staff motivated and productive.</p>\r\n<p>Please browse our gallery below for some examples of our office design and fitout.</p>', 1, 27, '2012-09-25 07:19:20', 469, '', '2014-12-10 10:40:53', 469, 0, '0000-00-00 00:00:00', '2012-09-25 07:19:20', '0000-00-00 00:00:00', '{"image_intro":"images\\/top_blocks\\/block1.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 10, 0, '', '', 1, 47, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(21, 75, 'Medical', 'technologies', '<p>Medical interior design and fitout in Perth, WA</p>\r\n', '\r\n<p>NRG INTERIORShas provided functional interior design and fitout solutions for your many medical suites, Clients include chiropractors, haematologists, anaesthetists, and cosmetic clinics.</p>\r\n<p>Experience with health requirements, medical industry specifics, and empathy for patients means that NRG INTERIORS can help you produce the best results for you medical practice.</p>\r\n<p>Please browse our gallery below for some examples of our medical suite design and fitout.</p>', 1, 27, '2012-09-25 07:19:20', 469, '', '2014-12-10 10:43:15', 469, 0, '0000-00-00 00:00:00', '2012-09-25 07:19:20', '0000-00-00 00:00:00', '{"image_intro":"images\\/top_blocks\\/block-medical.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 0, '', '', 1, 26, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(22, 76, 'Retail', 'latest-trends', '<p>Retail interior design and fitout in Perth, WA</p>\r\n', '\r\n<p>NRG INTERIORShas been involved in the design and fitout outmany retail shops. Our portfolio includes fashion, giftware, furniture, pharmacy, newsagency, and hairdressing salons.</p>\r\n<p>Good retailers need their shops to be attractive, have flexible displays, minimise theft and run efficiently. NRG INTERIORS understands all this.</p>\r\n<p>Please browse our gallery below for some examples of our retailshop design and fitout.</p>', 1, 27, '2012-09-25 07:19:20', 469, '', '2014-12-10 10:44:53', 469, 0, '0000-00-00 00:00:00', '2012-09-25 07:19:20', '0000-00-00 00:00:00', '{"image_intro":"images\\/top_blocks\\/block-retails.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 0, '', '', 1, 33, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(23, 77, 'Hospitality', 'decoration', '<p>Hospitality interior design and fitout in Perth, WA</p>\r\n', '\r\n<p>NRG INTERIORSunderstands what makes a great bar, café or restaurant. That’s why many clients have chosen NRG INTERIORSto design and fitout their hospitality venue.</p>\r\n<p>In such a competitive market, set up and running costs are as important as the décor and theme. That’s why experience and good planning matter.</p>\r\n<p>Please browse our gallery below for some examples of our hospitality design and fitout.</p>', 1, 27, '2012-09-25 07:19:20', 469, '', '2014-12-10 10:46:45', 469, 0, '0000-00-00 00:00:00', '2012-09-25 07:19:20', '0000-00-00 00:00:00', '{"image_intro":"images\\/top_blocks\\/block-hospitality.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 0, '', '', 1, 4, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(24, 78, 'About Us', 'lorem-ipsum-dolor-sit-amet-consectetuer-adipiscing-elit-praesent-vestibulum-molestie-lacus-aenean-nonummy-hendrerit-mauris-phasellus-porta-fusce-suscipit-varius-mi', '<p><strong>"Why aren''t things working in my business the way they used to?"</strong><br /> Often, changes in your business can mean that the premises you run your business out of are no longer ideal, or even suitable. Sometimes, making changeswill help. Other times, you might need completely new premises.</p>\r\n<p>Either way, it can be a disruptive and unsettling time for you, your staff, and your clients – and that’s not ideal for your business! And whatever you do, you want the best result.</p>\r\n<p><strong>"I think I know what I need, but I’m not really sure…"</strong><br /> Sometimes, as a result of changes to your business situation there comes a time when you need to take action.</p>\r\n<p>Determining what needs to be done, and the best way forward can seem daunting and confusing to many business owners. What happens if you do nothing? Who do you get advice from? What information or decisions are important? Now? Later? Move? Stay?</p>\r\n<p>How do you decide?</p>\r\n<p><strong>"What are my options?"</strong><br /> It''s your business, so you should have choices. That’s one of the reasons you’re in business, isn’t it?</p>\r\n<p>There are always options when it comes to the design and fitout of your business premises. Many options come with varying degrees of benefits and compromises.</p>\r\n<p>You can try to do it yourself, but without the necessary experience, you might make uninformed decisions which can be costly or have other negative or costly consequences for your business.</p>\r\n<p>Another option is to work with a qualified and experienced Interior Designer who can help you get the best results.</p>\r\n<p><strong>"What guarantees do I have that it will be done right?"</strong><br /> An experienced and competent interior designer can save you unnecessary cost and wastage.</p>\r\n<p>Effective interior design and fitout solutions can help your business grow and prosper. It can maximise the use of your floor space.It can provide benefits to how your business operates, through customised solutions, planning, and the use of suitable materials.</p>\r\n<p><strong>"Why use NRG INTERIORS?"</strong><br /> You will always get the best outcomes for your business if you choose the Interior Designer who is best suited to your business and project.</p>\r\n<p>Perhaps the first decision you need to make then, is who to trust and work with on the design or fitout of your business premises. And it should be a fully informed decision.</p>\r\n<p>By discussing your project with NRG INTERIORS, you will be in that position.</p>\r\n<p>We provide you with all the necessary information on interior design, fitout and project management so that you can make an informed decision on selecting the best interior designer for your project – whether it’s us or someone else At NRG INTERIORS, we help businesses become more profitable!</p>', '', 1, 9, '2012-09-25 07:19:20', 469, '', '2014-12-10 09:13:06', 469, 0, '0000-00-00 00:00:00', '2012-09-25 07:19:20', '0000-00-00 00:00:00', '{"image_intro":"images\\/about-1.jpg","float_intro":"left","image_intro_alt":"","image_intro_caption":"","image_fulltext":"images\\/about-1.jpg","float_fulltext":"left","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_re