(75, 145, 'Services', 'services', '<h6>All Interior Design and Fitout companies aren’t built the same</h6>\r\n<p>At NRG INTERIORS, we know that we are different to most other interior design and fitout companies.</p>\r\n<p>Why?<br /> Because we don’t focus on interior design and fitout. We focus on improving our clients’ businesses.</p>\r\n<p>Our philosophy is firmly based on treating our clients and their businesses the same way we and our business like to be treated – fairly, openly, honestly, and with the aim of always improving the return on investment.</p>\r\n<p>Supporting your business with a range of interior design, fitout, and project management services, at NRG INTERIORS we simply want to help businesses become more profitable!</p>', '', 1, 28, '2014-12-10 09:36:29', 469, '', '2014-12-10 11:01:54', 469, 0, '0000-00-00 00:00:00', '2014-12-10 09:36:29', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 4, '', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(76, 146, 'Interior Design Consulting', 'interior-design-consulting', '<h5>Good interior design…..is knowing when to stop</h5>\r\n<p>Many designers love to put their ‘stamp’ on the projects they work on. They get really excited by winning design awards and getting their work published in magazines. They often seek design perfection, no matter the cost.</p>\r\n<p>The real world of business isn’t like that though.</p>\r\n<p>Unfortunately, very few designers own their own business, which means that very few designers think like you – a business owner.</p>\r\n<p>At NRG INTERIORS you deal with Rocky Amatulli, the business owner. He understands the drivers of a successful business, and how effective interior design can translate to improved productivity, staff satisfaction, and increased profitability for your business.</p>', '', 1, 28, '2014-12-10 10:10:09', 469, '', '2014-12-10 11:01:01', 469, 0, '0000-00-00 00:00:00', '2014-12-10 10:10:09', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 3, '', '', 1, 9, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(77, 147, 'Fitout', 'fitout', '<p>A fitout which controls costs and time and achieves the desired outcomes is a successful fitout</p>\r\n<p>All fitouts have three main elements. At NRG INTERIORS, we refer to them at the N-R-G of fitout.</p>\r\n<p>They are:</p>\r\n<div class="list1">\r\n<ul>\r\n<li>Numbers (costs)</li>\r\n<li>Resources (time), and</li>\r\n<li>Goals (outcomes)</li>\r\n</ul>\r\n</div>\r\n<p>Every client and project is different when it comes to these three elements.</p>\r\n<p>That’s why you need to engage a company which understands and can control all three of these elements on your project – a company like NRG INTERIORS.</p>', '', 1, 28, '2014-12-10 10:13:54', 469, '', '2014-12-10 11:03:21', 469, 0, '0000-00-00 00:00:00', '2014-12-10 10:13:54', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 2, '', '', 1, 6, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(78, 148, 'Project Management Services', 'project-management-services', '<h5>Managing a project well usually involves managing people connected to that project well</h5>\r\n<p>Sometimes, you might want to simply engage NRG INTERIORS to prepare your design drawings and specifications, and use outside builders for the fitout.<br /><br />NRG INTERIORS offers you a Project Management service. NRG can help you to manage your fitout. Project Management services include calling and reviewing tenders, running meetings, tracking fitout progress, reviewing costs and invoices, and reporting back to you.</p>', '', 1, 28, '2014-12-10 10:15:00', 469, '', '2014-12-10 11:04:08', 469, 0, '0000-00-00 00:00:00', '2014-12-10 10:15:00', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 1, '', '', 1, 10, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(79, 149, 'Galleries', 'galleries', '<p>Coming soon...</p>', '', 1, 29, '2014-12-10 10:35:32', 469, '', '2014-12-10 12:39:07', 469, 469, '2014-12-10 12:39:07', '2014-12-10 10:35:32', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, '', '', 1, 8, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
