(40, 'index.php?option=com_content&view=article&id=76', 'index.php?option=com_content&view=article&id=76:interior-design-consulting&catid=28:services&Itemid=250', 'Interior Design Consulting', 'Good interior design…..is knowing when to stop Many designers love to put their ‘stamp’ on the projects they work on. They get really excited by winning design awards and getting their work published in magazines. They often seek design perfection, no mat', '2014-12-10 16:31:02', '65a282330966f995b02f06e3f3b05997', 1, 1, 1, 'en-GB', '2014-12-10 10:10:09', '0000-00-00 00:00:00', '2014-12-10 10:10:09', '0000-00-00 00:00:00', 0, 0, 3, );
