(1, 'com_content', 37, 'In neque arcu, vulputate vitae dignissim id, placerat adipiscing lorem. Nulla consectetur adipiscing metus vel pulvinar. Aenean molestie mauris non diam tincidunt faucibus. Integer odio dui, iaculis in congue eleifend, faucibus nec diam. Maecenas ac est odio, at dignissim dolor. Quisque gravida, purus vitae varius sagittis, odio erat venenatis nibh, eu interdum diam est eu sem. Vivamus luctus lectus sit amet lectus egestas cursus.', 'James Bernard', '', 'james_bernard@gmail.com', 'http://demolink.org', '127.0.0.1', 0, '2013-04-01 13:46:55', 0, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1, '2013-04-01 13:47:39', '0000-00-00 00:00:00', 0, 0, 0, 1, 2, 0, '', '', '', NULL),
