(4, 'com_content.article', 'Archive. Cras ligula nisi, interdum et vulputate nec', 'archive-cras-ligula-nisi-interdum-et-vulputate-nec', '<p>Sed justo felis, lacinia at scelerisque a, semper et ante. Fusce posuere lacus eu mi lacinia et fringilla elit sollicitudin. Maecenas non odio nunc. In ut sollicitudin magna. Sed sit amet tincidunt odio. Mauris pharetra adipiscing urna ut accumsan. Suspendisse nec risus in felis fermentum blandit.</p>\r\n<p>Nullam commodo blandit nunc id luctus. Morbi tincidunt sodales neque eu rutrum. Aliquam imperdiet ante nec augue aliquet eu rutrum eros tempor. Nulla sit amet risus eu ante dapibus malesuada. Donec volutpat dolor nec eros elementum ornare. Phasellus nec fringilla lectus. Nam eget sagittis nisl. Morbi erat metus, accumsan ultricies pharetra sodales, sagittis eu mi. Donec felis sapien, rutrum commodo viverra vel, ullamcorper id nunc. Fusce tristique nibh in leo egestas tristique. Phasellus elementum pharetra est, sed sollicitudin sapien vulputate nec. Praesent consectetur adipiscing egestas. Vivamus interdum imperdiet augue, pretium sagittis lacus imperdiet quis.</p>\r\n', 2, '', 0, 1, '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"theme1754:blog","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 0, '{"tags":[2],"robots":"","author":"","rights":"","xreference":""}', 846, '', '2012-03-01 13:43:03', 846, '2013-04-26 10:59:30', '*', '2012-03-01 13:43:03', '0000-00-00 00:00:00', 11, 140, '{"image_intro":"","float_intro":"","image_intro_alt":